package ua.andriosta.raiywayservice.params;

public class FlightParams {
	
	private Long date;
	private Long cityFrom;
	private Long cityTo;
	
	public FlightParams() {
		// TODO Auto-generated constructor stub
	}
	
	

	public Long getDate() {
		return date;
	}

	public void setDate(Long date) {
		this.date = date;
	}

	public Long getCityFrom() {
		return cityFrom;
	}

	public void setCityFrom(Long cityFrom) {
		this.cityFrom = cityFrom;
	}

	public Long getCityTo() {
		return cityTo;
	}

	public void setCityTo(Long cityTo) {
		this.cityTo = cityTo;
	}
	
   
}
